/**
 *  Countdown Timer Plugin 
 */
+function($) {
    'use strict';
    
    var MoveaCountdownTimer = function (element, options) {
        this.countdown('moveaCountdownTimer', element, options);
    }

    MoveaCountdownTimer.prototype.countdown = function(type, element, options){
        if (!sessionStorage.getItem('timezone')) {
            var tz = jstz.determine() || 'UTC';
            sessionStorage.setItem('timezone', tz.name());
        }
        var currTz = sessionStorage.getItem('timezone');
        //References to DOM elements
        
        var deliveryDate = "2018-05-01";
        var deliverTime = "17:00";
        var timezone ="Europe/Berlin";
        
        this.run(deliveryDate, deliverTime, currTz);
    }

    MoveaCountdownTimer.prototype.run = function(deliveryDate, deliverTime, currTz) {
  
        var $clock = $('#clock'),
        eventTime = moment.tz('03-05-2018 17:00:00', 'DD-MM-YYYY HH:mm:ss', 'Europe/Berlin').unix(),
        currentTime = moment().unix(),
        diffTime = eventTime - currentTime,
        duration = moment.duration(diffTime * 1000, 'milliseconds'),

        // stamp = deliveryDate + "T" + deliverTime + "Z",
        // momentTime = moment(stamp),
        // tzTime = momentTime.tz(currTz),

        interval = 1000;


        // if time to countdown
        if(diffTime > 0) {

            // Show clock
            // $clock.show();

            var $d = $('<span class="days" ><br>Day</span>').appendTo($clock),
                $h = $('<span class="hours" ><br>Hours</span>').appendTo($clock),
                $m = $('<span class="minutes" ><br>Minutes</span>').appendTo($clock),
                $s = $('<span class="seconds" ><br>Seconds</span>').appendTo($clock);

            setInterval(function(){

                duration = moment.duration(duration.asMilliseconds() - interval, 'milliseconds');
                var d = moment.duration(duration).days(),
                    h = moment.duration(duration).hours(),
                    m = moment.duration(duration).minutes(),
                    s = moment.duration(duration).seconds();

                var ds = ($.trim(d) == '1' || $.trim(d) == '0') ? 'Day': 'Days';
                var hs = ($.trim(h) === '1' || $.trim(h) === '0') ? 'Hour': 'Hours';
                var ms = ($.trim(m) == '1' || $.trim(m) == '0') ? 'Minute': 'Minutes';
                var ss = ($.trim(s) == '1' || $.trim(s) == '0') ? 'Second': 'Seconds';
                
                d = $.trim(d).length === 1 ? '0' + d : d;
                h = $.trim(h).length === 1 ? '0' + h : h;
                m = $.trim(m).length === 1 ? '0' + m : m;
                s = $.trim(s).length === 1 ? '0' + s : s;

                // show how many hours, minutes and seconds are left
                $d.html(d + '<p class="date">' + ds + '</p>');
                $h.html(h + '<p class="date">' + hs + '</p>');
                $m.html(m + '<p class="date">' + ms + '</p>');
                $s.html(s + '<p class="date">' + ss + '</p>');

            }, interval);

        } else {
            $('<span>The kick off is running on Indiegogo already. Please check out movea bikes on there!</span>').appendTo($clock)
        }
    }

    function Plugin(option) {
        return this.each(function () {
            var $this = $(this)
            var data = $this.data('toothless.countdownTimer')
            var options = typeof option == 'object' && option
            
            if (!data && /destory|hide/.test(option)) return
            if(!data) $this.data('toothless.countdownTimer', (data = new MoveaCountdownTimer(this, options)))
            if (typeof option == 'string') data[option]()
        })
    }
    var old = $.fn.MoveaCountdownTimer
    $.fn.MoveaCountdownTimer = Plugin
    $.fn.MoveaCountdownTimer.constructor = MoveaCountdownTimer

    // Split Section No Conflict
    //============================

    $.fn.MoveaCountdownTimer.noConflict = function () {
        $.fn.MoveaCountdownTimer = old
        return this
    }
}(jQuery)
